const App = () => {
    const course = {
        id: 1,
        name: 'Half Stack application development bloo face baby ü¶ç',
        parts: [
            {
                name: 'Fundamentals of React',
                exercises: 10,
                id: 1
            },
            {
                name: 'Using props to pass data',
                exercises: 7,
                id: 2
            },
            {
                name: 'State of a component',
                exercises: 14,
                id: 3
            }
        ]
    }

    return <Course course={course} />
}

const Course = ({props}) => {
    return <div>
        <Header name = {props.name}/>
        <Content parts = {(props).parts}/>
    </div>
}
const Header = ({props}) =>{
    return <h1>{props.name}</h1>;
}

const Part = ({props}) => {
    return(
        <p>{props.name} {props.exercises}</p>
    );
}

const Content = ({props}) => {
    return (
        <div>
            {props.parts.map((e, i) => {
                return <Part key={i} props = {e.parts}/>
            })}
        </div>
    );
}
export default App
